import React, { useState, useEffect } from "react";
import axios from "axios";
import Template from "../../components/Template";
import { Container, Hr } from "../../components/Admin/baseStyle";
import Sidebar from "../../src/components/admin/Sidebar";
//import ListResellers from "../../components/Admin/Resellers/ListResellers";
//import AddReseller from "../../components/Admin/Resellers/AddReseller";

function Reseller() {
  const [resellers, setResellers] = useState([]);

  useEffect(() => {
    function _getResellers() {
      getResellers();
    }
    _getResellers();
  }, []);
  return (
    <Template>
      <Nav />
      <Container>
        <div style={{ width: "100%" }}>
          <h1
            className="main-title"
            style={{
              textAlign: "center",
              color: "rgb(35,43,111)"
            }}
          >
            Revendedores
          </h1>
          <Hr />
          <div style={{ marginTop: "50px", padding: "0 15px" }}>
            <ListResellers getResellers={getResellers} resellers={resellers} />
          </div>
          <div style={{ marginTop: "50px", padding: "0 15px" }}>
            <AddReseller getResellers={getResellers} />
          </div>
        </div>
      </Container>
    </Template>
  );

  function getResellers() {
    axios
      .get("/reseller")
      .then(response => {
        setResellers(response.data);
      })
      .catch(err => {
        setResult(false);
        setMessage(err.response.data);
        setVisible(true);
      });
  }
}

export default Reseller;
